Ember.TEMPLATES["templates/application"]=Ember.Handlebars.compile("{{ outlet }}");Ember.TEMPLATES["templates/blank"]=Ember.Handlebars.compile("<p>Hi there! :-)</p>");Ember.TEMPLATES["templates/boxes/box"]=Ember.Handlebars.compile("<div {{action didClickBoxTitle this target=\"view\"}} class='title expandable'>\n  <div {{bindAttr class=\":stateOrb stateForOrb\"}}></div>\n  <h3 class='name'>\n    {{ name }}\n    {{#if notOwnBox}}<div class='pull-right'>\n      <i class='icon-group' title='Shared Box'></i>\n    </div>{{/if}}\n  </h3>\n</div>\n<div class='details'>\n  {{#if region.enabled}}<table>\n  <tr>\n    <th>State</th>\n    <td>\n      {{ stateForDisplay }}\n      {{#if terminated}}<a class='explain icon-question-sign' href='#' title='Terminated boxes will be removed automatically after couple of hours'></a>{{/if}}\n    </td>\n  </tr>\n  <tr>\n    <th>Memory</th>\n    <td>\n      {{ memory }} MB\n    </td>\n  </tr>\n  <tr>\n    <th>Storage</th>\n    <td>\n      {{ storage }} MB\n    </td>\n  </tr>\n  <tr>\n    <th>SSH URI</th>\n    <td>\n      {{#unless terminated}}<a {{bindAttr href=\"sshURI\"}} class='link'>{{ sshURI }}</a>{{/unless}}\n    </td>\n  </tr>\n  <tr>\n    <th>Region</th>\n    <td>{{ region.description }}</td>\n  </tr>\n  <tr>\n    <th>Stack</th>\n    <td>{{ version }} - {{ boxTemplate.name }}</td>\n  </tr>\n  <tr>\n    <th>Preview URI</th>\n    <td>\n      {{#unless terminated}}https://{{ boxHost }}:&lt;port&gt;{{/unless}}\n    </td>\n  </tr>\n  <tr>\n    <th>Public Key</th>\n    <td>\n      {{#if running}}{{#unless public_key}}{{#unless loadingPublicKey}}<a {{action didClickRevealPublicKey this target=\"view\"}} class='link'>\n        Reveal Public Key\n      </a>\n      {{else}}\n      <span class='loading'>Fetching Public Key...</span>{{/unless}}\n      {{else}}\n      {{view AIO.SelectableTextField class=\"box_text_field\" valueBinding=\"public_key\"}}\n      {{view AIO.CopyButtonView dataClipboardTextBinding=\"public_key\"}}\n      {{#if AIO.currentUser.isGithubAuthenticated}}{{#unless addingPublicKeyToGitHub}}<a {{action didClickAddToGitHub this target=\"view\"}} class='link'>Add to GitHub</a>\n      {{else}}\n      <span class='loading'>Adding Public Key to GitHub...</span>{{/unless}}\n      {{else}}\n      <a class='link' href='/app#/n2o/bonus'>Add to GitHub</a>{{/if}}{{/unless}}\n      {{ publicKeyInfo }}{{/if}}\n    </td>\n  </tr>\n</table>\n<div class='details-actions'>\n  {{#if underMaintenance}}<button class='btn' disabled='disabled'>\n    Under Maintenance!\n  </button>{{/if}}\n  {{#if stopped}}{{#if ownBox}}<button {{bindAttr disabled=\"loading\"}} {{action didClickStart this target=\"view\"}} class='btn btn-primary'>\n    Start\n  </button>\n  <span class='help-inline'>\n    {{ firstErrors.base }}\n  </span>\n  <div class='pull-right'>\n    <button {{bindAttr disabled=\"loading\"}} {{action didClickTerminate this target=\"view\"}} class='btn btn-danger'>\n      Terminate\n    </button>\n  </div>{{/if}}{{/if}}\n  {{#if failed}}{{#if ownBox}}<button {{bindAttr disabled=\"loading\"}} {{action didClickRetryProvisioning this target=\"view\"}} class='btn btn-primary'>\n    Retry\n  </button>\n  <span class='help-inline'>\n    {{ firstErrors.base }}\n  </span>{{/if}}{{/if}}\n  {{#if running}}{{#if AIO.util.IsMobile}}<button {{bindAttr disabled=\"loading\"}} {{action didClickTerminal this target=\"view\"}} class='btn btn-primary'>\n    Terminal\n  </button>\n  {{else}}\n  <button {{bindAttr disabled=\"loading\"}} {{action didClickIDE this target=\"view\"}} class='btn btn-primary'>\n    IDE\n  </button>\n  <button {{bindAttr disabled=\"loading\"}} {{action didClickTerminal this target=\"view\"}} class='btn'>\n    Terminal\n  </button>{{/if}}\n  {{#if ownBox}}<button {{bindAttr disabled=\"loading\"}} {{action didClickSettings this target=\"view\"}} class='btn'>\n    Settings\n  </button>{{/if}}\n  <span class='help-inline'>\n    {{ firstErrors.base }}\n  </span>\n  {{#if ownBox}}<div class='pull-right'>\n    <button {{bindAttr disabled=\"loading\"}} {{action didClickRestart this target=\"view\"}} class='btn'>\n      Restart\n    </button>\n    <button {{bindAttr disabled=\"loading\"}} {{action didClickShutDown this target=\"view\"}} class='btn'>\n      Shut Down\n    </button>\n  </div>{{/if}}{{/if}}\n  {{#if notOwnBox}}<div class='pull-right'>\n    <button {{bindAttr disabled=\"loading\"}} {{action didClickLeave this target=\"view\"}} class='btn'>\n      Leave\n    </button>\n  </div>{{/if}}\n  {{#if terminated}}<button class='btn' disabled='disabled'>\n    Terminated!\n  </button>{{/if}}\n  {{#if 'under maintenance'}}<button class='btn' disabled='disabled'>\n    Under Maintenance!\n  </button>{{/if}}\n  {{#if provisioning}}<button {{action didClickProvisioning this target=\"view\"}} class='btn'>\n    Provisioning...\n  </button>{{/if}}\n  {{#if working}}<button class='btn' disabled='disabled'>\n    Please wait...\n  </button>{{/if}}\n</div>\n{{else}}\n<table>\n  <tr>\n    <th>State</th>\n    <td>Under Maintenance</td>\n  </tr>\n</table>{{/if}}\n</div>");
Ember.TEMPLATES["templates/boxes/box_template"]=Ember.Handlebars.compile("<div>\n  {{#with view.boxTemplate}}<div {{bindAttr class=\":image runtime\"}}></div>\n  <a class='stack-label' href='#'>{{ name }}</a>{{/with}}\n</div>");Ember.TEMPLATES["templates/boxes/confirm_terminate_dialog"]=Ember.Handlebars.compile("<div class='modal-header'>\n  <h3>\n    Are you\n    <strong>ABSOLUTELY</strong>\n    sure?\n  </h3>\n</div>\n<div class='modal-body'>\n  <p>\n    This action\n    <strong>CANNOT</strong>\n    be undone! This will delete all files and settings in\n    &ldquo;{{ view.content.box.name }}&rdquo;\n    permanently.\n  </p>\n  <p>\n    Please type in the name of the box to confirm.\n  </p>\n  <div class='form-horizontal'>\n    <div>\n      {{view AIO.ConfirmTerminateDialogTextField id=\"box_name\" valueBinding=\"view.enteredName\"}}\n    </div>\n  </div>\n</div>\n<div class='modal-footer'>\n  <button {{action didClickCancel target=\"view\"}} class='btn'>\n    Cancel\n  </button>\n  <button {{bindAttr disabled=\"view.nameMismatch\"}} {{action didClickTerminate target=\"view\"}} class='btn btn-danger'>\n    Terminate\n  </button>\n</div>");
Ember.TEMPLATES["templates/boxes/edit"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView}}\n  <h2>{{ view.name }}</h2>\n  <div class='info'>\n    <p>Note: Reconfiguring your box will result in it being rebooted.</p>\n  </div>\n  <form class='form-horizontal'>\n    <div class='control-group'>\n      <label class='control-label'>Memory</label>\n      <div class='controls'>\n        {{view AIO.SliderView valueBinding=\"memory\" min=384 max=2048 step=128 unit=\" MB\"}}\n        <div class='usage-details'>\n          {{#if view.memoryUsageDetails}}{{view.memoryUsageDetails}}\n          {{else}}\n          fetching current memory usage{{/if}}\n        </div>\n        <div class='n2o-cost'>\n          <i class='icon-bolt'></i>\n          {{ view.memoryCostChange }}\n        </div>\n      </div>\n    </div>\n    <div class='control-group'>\n      <label class='control-label'>Storage</label>\n      <div class='controls'>\n        {{view AIO.SliderView valueBinding=\"storage\" min=750 max=10000 step=250 unit=\" MB\"}}\n        <div {{bindAttr class=\":usage-details view.insufficientStorage:error\"}}>\n          {{#if view.storageUsageDetails}}{{view.storageUsageDetails}}\n          {{else}}\n          fetching current storage{{/if}}\n        </div>\n        <div class='n2o-cost'>\n          <i class='icon-bolt'></i>\n          {{ view.storageCostChange }}\n        </div>\n      </div>\n    </div>\n    <div class='control-group'>\n      <label class='control-label'>Remaining N2O</label>\n      <div class='controls remaining-n2o-slider'>\n        {{view AIO.SliderView valueBinding=\"view.remainingN2O\" min=0 maxBinding=\"view.maxN2O\" step=1 readOnly=true}}\n        <div class='n2o-cost'>\n          <i class='icon-bolt'></i>\n          {{ view.totalCostChange }}\n        </div>\n      </div>\n    </div>\n    <div {{bindAttr class=\":control-group errors.base:error view.insufficientN2O:error\"}}>\n      <div class='controls'>\n        <button {{bindAttr disabled=\"view.saveChangesButtonDisabled\"}} {{action didClickChangeBox target=\"view\"}} class='btn btn-primary'>\n          Save Changes\n        </button>\n        <button {{bindAttr disabled=\"saving\"}} {{action didClickCancel target=\"view\"}} class='btn'>\n          Cancel\n        </button>\n        <span class='help-inline'>\n          {{ firstErrors.base }}\n          {{#if view.insufficientN2O}}You do not have enough N2O to reconfigure your box.\n          <a class='link' href='/app#n2o/bonus'>Get More</a>{{/if}}\n          {{#if view.insufficientStorage}}You are using more storage than the requested amount.{{/if}}\n        </span>\n      </div>\n    </div>\n  </form>\n</div>");
Ember.TEMPLATES["templates/boxes/index"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView}}\n  {{#unless AIO.currentUser.isConfirmed}}<div class='alert alert-error confirm-email-reminder'>\n    <button class='close' data-dismiss='alert'></button>\n    <strong>Important:</strong>\n    <a href='/users/confirmation/new'>\n      Please take a moment to confirm your email address and\n      <strong>\n        earn\n        {{ AIO.router.n2oBonusController.bonusInfo.sign_up }}\n        units of N2O.\n      </strong>\n    </a>\n  </div>{{/unless}}\n  <h2>Boxes</h2>\n  <ul class='boxes dark-list'>\n    {{#each arrangedContent}}{{ view AIO.BoxView boxBinding=\"this\" }}{{/each}}\n  </ul>\n  {{#unless length}}<div class='dark-list'>\n    <div class='title'>\n      <p>You have not created any boxes.</p>\n    </div>\n  </div>{{/unless}}\n  <div class='panel'>\n    <button {{action didClickNewBox target=\"view\"}} class='btn btn-primary'>\n      New Box\n    </button>\n    <button {{action didClickRefresh target=\"view\"}} class='btn'>\n      Refresh\n    </button>\n  </div>\n</div>\n{{view AIO.ConfirmTerminateDialogView}}");
