Ember.TEMPLATES["templates/ide/upload_dialog"]=Ember.Handlebars.compile("<div class='modal-header'>\n  <h3>Upload Files to &ldquo;{{ view.content.path.name }}&rdquo;</h3>\n</div>\n<div class='modal-body'>\n  {{#if view.dragAndDropCapable}}{{#view AIO.IdeUploadDialogDropZoneView}}<p>\n    Drop files here or\n    <span {{bindAttr disabled=\"view.parentView.content.uploading\"}} class='btn'>\n      Browse...\n      <input {{bindAttr disabled=\"view.parentView.content.uploading\"}} class='file_input' multiple='multiple' name='files[]' type='file' />\n    </span>\n    <small>(max 20MB/file)</small>\n  </p>{{/view}}\n  {{else}}\n  <p>\n    <span class='btn'>\n      Add Files...\n      <input {{bindAttr disabled=\"view.content.uploading\"}} class='file_input' multiple='multiple' name='files[]' type='file' />\n      <small>(max 20MB/file)</small>\n    </span>\n  </p>{{/if}}\n  <ul class='modal-list'>\n    {{#each view.content}}<li>\n      <p>{{ fileName }}</p>\n      <div class='pull-right'>\n        {{#if view.content.uploading}}<div {{bindAttr class=\":progress failed:progress-danger\"}}>\n          <div {{bindAttr style=\"widthStyle\"}} class='bar'></div>\n        </div>\n        {{else}}\n        <button {{action didClickRemoveUpload this target=\"view\"}} class='btn btn-danger'>\n          Remove\n        </button>{{/if}}\n      </div>\n    </li>{{/each}}\n  </ul>\n</div>\n<div class='modal-footer'>\n  <button {{bindAttr disabled=\"view.content.uploading\"}} {{action didClickCancel target=\"view\"}} class='btn'>\n    Cancel\n  </button>\n  <button {{bindAttr disabled=\"view.content.uploading\"}} {{action didClickUpload target=\"view\"}} class='btn'>\n    Upload\n  </button>\n</div>");
Ember.TEMPLATES["templates/intro/intro_five"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView noMenu=true}}\n  <div class='intro-content'>\n    <div class='iright'>\n      <div class='screenshot-container'>\n        <div class='intro-n2o'></div>\n      </div>\n    </div>\n    <div class='ileft'>\n      <div class='info-container'>\n        <h2>N2O Capacity</h2>\n        <p>You can create an unlimited number of boxes, each up to 2GB RAM and 10GB Storage.</p>\n        <p>Increasing the resources on a box requires additional N2O capacity on your account. We start you off with enough resources for a basic box for free.</p>\n        <p>\n          You can get more N2O by\n          <a class='link' href='/app#/invites'>inviting friends &amp; collaborators,</a>\n          and by connecting your\n          <a class='link' href='app#/n2o/bonus'>Github and Google accounts.</a>\n        </p>\n        <div class='hlinks'>\n          <h4>Helpful Links</h4>\n          <ul>\n            <li>\n              <a class='link' href='/app#/n2o/bonus'>Earn More N2O</a>\n            </li>\n            <li>\n              <a class='link' href='http://help.nitrous.io/N2O' target='_blank'>Read about N2O Capacity</a>\n            </li>\n          </ul>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class='panel'>\n    <button {{action didClickDone target=\"view\"}} class='btn btn-success pull-right'>\n      Okay, I&rsquo;m Ready!\n    </button>\n    <button {{action didClickPrevScreen target=\"view\"}} class='btn'>\n      Previous\n    </button>\n  </div>\n</div>");
Ember.TEMPLATES["templates/intro/intro_four"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView noMenu=true}}\n  <div class='intro-content'>\n    <div class='iright'>\n      <div class='screenshot-container'>\n        <div class='intro-collaboration'></div>\n      </div>\n    </div>\n    <div class='ileft'>\n      <div class='info-container'>\n        <h2>Code Together</h2>\n        <p>\n          Sometimes you need motivation to make progress on an app. Or a little education on a new language or framework. Pair programming is great, but it's tough when you're not in the same room.\n        </p>\n        <p>\n          With Nitrous.IO, you can invite any number of collaborators to join your box so you can code collaboratively all in the browser.\n        </p>\n        <div class='hlinks'>\n          <h4>Helpful Links</h4>\n          <ul>\n            <li>\n              <a class='link' href='http://help.nitrous.io/collab' target='_blank'>Getting Started with Collaboration</a>\n            </li>\n          </ul>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class='panel'>\n    <button {{action didClickNextScreen target=\"view\"}} class='btn btn-primary pull-right'>\n      Next\n    </button>\n    <button {{action didClickPrevScreen target=\"view\"}} class='btn'>\n      Previous\n    </button>\n  </div>\n</div>");
Ember.TEMPLATES["templates/intro/intro_one"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView noMenu=true}}\n  <div class='intro-content'>\n    <div class='iright'>\n      <div class='screenshot-container'>\n        <div class='intro-welcome'></div>\n      </div>\n    </div>\n    <div class='ileft'>\n      <div class='info-container'>\n        <h2>Getting Started on Nitrous.IO</h2>\n        <p>\n          Nitrous.IO helps you work faster, smarter, and more efficiently.\n        </p>\n        <p>\n          You can create any number of new development boxes, using our box templates to get up and running quickly.\n        </p>\n        <p>\n          This introduction will demonstrate some of the powerful features available to you.\n        </p>\n        <div class='buttons'>\n          <button {{action didClickNextScreen target=\"view\"}} class='btn btn-success go'>Get Started</button>\n          <button {{action didClickSkipIntro target=\"view\"}} class='btn'>Skip Intro</button>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class='panel clearfix'>\n    <button {{action didClickNextScreen target=\"view\"}} class='btn btn-primary pull-right'>\n      Next\n    </button>\n  </div>\n</div>");
Ember.TEMPLATES["templates/intro/intro_three"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView noMenu=true}}\n  <div class='intro-content'>\n    <div class='iright'>\n      <div class='screenshot-container'>\n        <div class='intro-ide'></div>\n      </div>\n    </div>\n    <div class='ileft'>\n      <div class='info-container'>\n        <h2>Working on Boxes</h2>\n        <p>\n          You can code on your boxes in a variety of ways. Currently, you can use the Nitrous.IO WebIDE, or you can SSH into your box and use VIM or Emacs.\n        </p>\n        <p>\n          We're working on adding more ways for you to connect and work on your boxes, we'll be launching these soon.\n        </p>\n        <div class='hlinks'>\n          <h4>Helpful Links:</h4>\n          <ul>\n            <li>\n              <a class='link' href='http://help.nitrous.io/ide-general/' target='_blank'>Getting Started with the WebIDE</a>\n            </li>\n            <li>\n              <a class='link' href='http://help.nitrous.io/categories/ssh/' target='_blank'>Connecting to box via SSH</a>\n            </li>\n          </ul>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class='panel'>\n    <button {{action didClickNextScreen target=\"view\"}} class='btn btn-primary pull-right'>\n      Next\n    </button>\n    <button {{action didClickPrevScreen target=\"view\"}} class='btn'>\n      Previous\n    </button>\n  </div>\n</div>");
Ember.TEMPLATES["templates/intro/intro_two"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView noMenu=true}}\n  <div class='intro-content'>\n    <div class='iright'>\n      <div class='screenshot-container'>\n        <div class='intro-new-box'></div>\n      </div>\n    </div>\n    <div class='ileft'>\n      <div class='info-container'>\n        <h2>Creating Boxes</h2>\n        <p>\n          Boxes are the heart and soul of the Nitrous.IO platform. You can create any number of boxes with any supported languages and frameworks.\n        </p>\n        <p>\n          <p>We currently support <a href='http://www.ruby-lang.org/en/'>Ruby</a>, <a href='http://www.python.org/'>Python</a>, <a href='http://golang.org/'>Go</a> and <a href='http://nodejs.org/'>NodeJS</a> boxes. You can create a box with up to 2GB of RAM and 10GB of storage.</p>\n        </p>\n        <div class='hlinks'>\n          <h4>Helpful Links:</h4>\n          <ul>\n            <li>\n              <a class='link' href='http://help.nitrous.io/box-new/' target='_blank'>Creating a Box</a>\n            </li>\n            <li>\n              <a class='link' href='http://help.nitrous.io/box-templates/' target='_blank'>Box Templates</a>\n            </li>\n          </ul>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class='panel'>\n    <button {{action didClickNextScreen target=\"view\"}} class='btn btn-primary pull-right'>\n      Next\n    </button>\n    <button {{action didClickPrevScreen target=\"view\"}} class='btn'>\n      Previous\n    </button>\n  </div>\n</div>");
Ember.TEMPLATES["templates/invites/index"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView}}\n  <h2 class='hero-title'>Code Better, Together</h2>\n  <div class='invite-stream-container clearfix'>\n    <div class='row'>\n      <div class='span2 invite-item-container'>\n        <i class='icon-user'></i>\n        <h5>Invite User</h5>\n        <div class='iexplain'>Send out an invite or share your referral link</div>\n      </div>\n      <div class='span3 stream-container'>\n        <div class='stream'>\n          next\n        </div>\n      </div>\n      <div class='span2 invite-item-container'>\n        <i class='icon-upload'></i>\n        <h5>User Accepts</h5>\n        <div class='iexplain'>Friend uses your referral code to signup</div>\n      </div>\n      <div class='span3 stream-container'>\n        <div class='stream'>\n          next\n        </div>\n      </div>\n      <div class='span2 invite-item-container'>\n        <i class='icon-ok'></i>\n        <h5><span>+</span>{{ AIO.router.n2oBonusController.bonusInfo.invite_friends }} N2O\n        </h5>\n        <div class='iexplain'>\n          Additional resources are added to your account\n          <span class='footnote'>\u271d</span>\n        </div>\n      </div>\n    </div>\n  </div>\n  <div class='referral-link-container'>\n    <form class='form-inline form referral-link'>\n      <label>Your Referral Link</label>\n      {{view AIO.InvitesReferralLinkTextField valueBinding=\"AIO.currentUser.referralLinkFullURL\" class=\"reflink\" readonly=\"readonly\"}}\n      {{view AIO.CopyButtonView dataClipboardTextBinding=\"AIO.currentUser.referralLinkFullURL\"}}\n      <span class='help-block'>\n        Share this link with friends to add units of N2O to your account.\n      </span>\n      <div>\n        {{view AIO.FacebookShareButtonView urlBinding=\"AIO.currentUser.referralLinkFullURL\"}}\n        {{view AIO.GooglePlusShareButtonView urlBinding=\"AIO.currentUser.referralLinkFullURL\"}}\n        {{view AIO.TwitterShareButtonView urlBinding=\"AIO.currentUser.referralLinkFullURL\"}}\n      </div>\n    </form>\n  </div>\n  <div class='invites-table-container'>\n    <div class='invite-form-container'>\n      <form class='form-inline form dash-search invite-users'>\n        <label>Invite Friends</label>\n        {{view AIO.InvitesIndexTextField valueBinding=\"view.emailFieldText\"}}\n        <button {{bindAttr disabled=\"controller.saving\"}} {{action didClickInvite target=\"view\"}} class='btn'>\n          Invite\n        </button>\n        <span class='help-inline'>{{ controller.error }}</span>\n      </form>\n    </div>\n    <table class='table'>\n      <thead>\n        <tr>\n          <th>Email</th>\n          <th>Status</th>\n          <th>Sent</th>\n          <th>N2O Earned</th>\n        </tr>\n      </thead>\n      {{#each arrangedContent}}<tr>\n        <td class='important'>\n          {{ email }}\n        </td>\n        <td>\n          {{ humanizedState }}\n        </td>\n        <td>\n          {{ humanizedCreatedAt }}\n        </td>\n        <td>\n          {{#if n2o_earned}}<i class='icon-ok'></i>{{/if}}\n          {{ humanizedN2oEarned }}\n        </td>\n      </tr>{{/each}}\n    </table>\n    {{#unless length}}<tr>\n      <td colspan='6' style='text-align: center'>\n        <p>Oops, you haven't invited any friends yet</p>\n      </td>\n    </tr>{{/unless}}\n  </div>\n  <div class='invites-footnotes iexplain'>\n    <p>\n      <span class='footnote'>\u271d</span>\n      For the first\n      {{ AIO.currentUser.rewardable_invites_count }}\n      friends that sign up with your referral code, we will allocate\n      {{ AIO.router.n2oBonusController.bonusInfo.invite_friends }}\n      units N2O to your Nitrous.IO account. For subsequent sign ups, you will be allocated\n      {{ AIO.router.n2oBonusController.bonusInfo.invite_friends_extra }}\n      unit of N2O per sign up.\n    </p>\n  </div>\n</div>");
Ember.TEMPLATES["templates/n2o/bonus"]=Ember.Handlebars.compile('<div class=\'container\'>\n  {{view AIO.HeaderView}}\n  <h2>Earn More N2O</h2>\n  <div class=\'info\'>\n    <p>You can earn more N2O by completing the following goals.</p>\n  </div>\n  <ul class=\'dark-list\'>\n    {{#if content.accepted_invite}}{{view AIO.N2oBonusItemView name="Accept Invitation" icon="icon-star" completed=true}}{{/if}}\n    {{view AIO.N2oBonusItemView name="Complete Sign Up" icon="icon-user" completed=true}}\n    {{view AIO.N2oBonusItemView name="Invite Friends & Colleagues" icon="icon-group" completedBinding="content.invite_friends" rewardBinding="bonusInfo.invite_friends" route="invites.index"}}\n    {{#if view.isUsingChrome}}{{view AIO.N2oBonusItemView name="Install Chrome App" icon="icon-google-plus-sign" completedBinding="content.chrome_app" rewardBinding="bonusInfo.chrome_app" targetBinding="view" action="installChromeApp"}}{{/if}}\n    {{view AIO.N2oBonusItemView name="Connect GitHub"   icon="icon-github"      completedBinding="content.github"   rewardBinding="bonusInfo.github" url="/users/auth/github"}}\n    {{view AIO.N2oBonusItemView name="Connect Google"   icon="icon-google-plus" completedBinding="content.google"   rewardBinding="bonusInfo.google" url="/users/auth/google_oauth2"}}\n    {{view AIO.N2oBonusItemView name="Connect LinkedIn" icon="icon-linkedin"    completedBinding="content.linkedin" rewardBinding="bonusInfo.linkedin" url="/users/auth/linkedin"}}\n    {{view AIO.N2oBonusItemView name="Connect Twitter"  icon="icon-twitter"     completedBinding="content.twitter"  rewardBinding="bonusInfo.twitter"  url="/users/auth/twitter"}}\n    {{view AIO.N2oBonusItemView name="Follow @nitrousio on Twitter" icon="icon-twitter"  completedBinding="content.twitter_follow" rewardBinding="bonusInfo.twitter_follow" enabledBinding="content.twitter" targetBinding="view" action="followOnTwitter"}}\n    {{view AIO.N2oBonusItemView name="Tweet about Nitrous.IO" icon="icon-twitter"  completedBinding="content.tweet_sent" rewardBinding="bonusInfo.tweet_sent" enabledBinding="content.twitter" targetBinding="view" action="composeTweet"}}\n    {{view AIO.N2oBonusItemView name="Connect Facebook" icon="icon-facebook"    completedBinding="content.facebook" rewardBinding="bonusInfo.facebook" url="/users/auth/facebook"}}\n  </ul>\n</div>\n{{view AIO.ComposeTweetDialogView}}');
Ember.TEMPLATES["templates/n2o/bonus_item"]=Ember.Handlebars.compile("<div class='title clickable'>\n  <span class='pull-right'>\n    {{#if view.completed}}<i class='icon-ok'></i>\n    {{ else }}\n    <i class='icon-bolt'></i>\n    {{ view.reward }}{{/if}}\n  </span>\n  <i {{bindAttr class=\"view.icon\"}}></i>\n  <span class='name'>\n    {{ view.name }}\n  </span>\n</div>");Ember.TEMPLATES["templates/n2o/compose_tweet_dialog"]=Ember.Handlebars.compile('<div class=\'modal-header\'>\n  <h3>\n    Share why you love Nitrous.IO on Twitter\n  </h3>\n</div>\n<div class=\'modal-body\'>\n  {{view AIO.ComposeTweetDialogTextArea id="message" valueBinding="view.message"}}\n</div>\n<div class=\'modal-footer\'>\n  <div {{bindAttr class=":tweet-counter view.messageInvalid:invalid"}}>\n    {{ view.messageLength }} / 140\n  </div>\n  <button {{action didClickCancel target="view"}} class=\'btn\'>\n    Cancel\n  </button>\n  <button {{bindAttr disabled="view.messageInvalid"}} {{action didClickSendTweet target="view"}} class=\'btn\'>\n    Tweet\n  </button>\n</div>');
Ember.TEMPLATES["templates/partials/header"]=Ember.Handlebars.compile("{{#unless view.hideHeader}}<header id='page-header'>\n  <div class='header-logo'></div>\n  <h1>\n    <a href='#'>Nitrous<span>.IO</span></a>\n  </h1>\n  {{#unless view.noMenu}}<ul class='header-nav'>\n    {{view AIO.N2OView}}\n    <li>\n      <a href='#/invites'>Invites</a>\n    </li>\n    <li>\n      <a href='#/boxes'>Boxes</a>\n    </li>\n    <li>\n      <a href='#/public_keys'>Public Keys</a>\n    </li>\n    <li class='dropdown'>\n      <a class='dropdown-toggle' data-toggle='dropdown'>\n        <span>Help</span>\n        <span class='caret'></span>\n      </a>\n      <ul class='dropdown-menu'>\n        <li>\n          <a href='http://help.nitrous.io/' target='_blank'>Help Center</a>\n        </li>\n        <li>\n          <a href='http://help.nitrous.io/categories/faq' target='_blank'>Frequently Asked Questions</a>\n        </li>\n        <li>\n          <a href='#/intro'>Replay Introduction</a>\n        </li>\n        <li class='divider'></li>\n        <li>\n          <a href='http://blog.nitrous.io/' target='_blank'>Blog</a>\n        </li>\n        <li>\n          <a href='http://updates.nitrous.io/' target='_blank'>Updates</a>\n        </li>\n        <li class='divider'></li>\n        <li>\n          <a href='mailto:support@nitrous.io?subject=Nitrous.IO%20Beta%20Feedback' target='_blank'>Report an Issue...</a>\n        </li>\n      </ul>\n    </li>\n    <li class='dropdown'>\n      <a class='dropdown-toggle' data-toggle='dropdown'>\n        <span>{{ AIO.currentUser.username }}</span>\n        <span class='caret'></span>\n      </a>\n      <ul class='dropdown-menu'>\n        <li>\n          <a href='#/n2o/bonus'>\n            Earn More N2O...\n          </a>\n        </li>\n        <li class='divider'></li>\n        <li>\n          <a href='/users/edit' target='_blank'>\n            Account Settings\n          </a>\n        </li>\n        <li>\n          <a href='/oauth/authorized_applications' target='_blank'>\n            Applications\n          </a>\n        </li>\n        <li class='divider'></li>\n        <li>\n          <a data-method='delete' href='/users/sign_out' rel='nofollow'>\n            Sign Out\n          </a>\n        </li>\n      </ul>\n    </li>\n  </ul>{{/unless}}\n</header>\n<hr id='header-bottom' />{{/unless}}");
Ember.TEMPLATES["templates/partials/n2o"]=Ember.Handlebars.compile("<div {{bindAttr style=\"view.barWidthStyle\"}} class='bar'></div>\n<div class='text' title='N2O'>\n  <i class='icon-bolt'></i>\n  {{ view.freeN2O }} / {{ view.maxN2O }}\n</div>");Ember.TEMPLATES["templates/public_keys/index"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView}}\n  <h2>SSH Public Keys</h2>\n  <ul class='public_keys dark-list'>\n    {{#each arrangedContent}}<li>\n      <div class='title'>\n        <h3 class='name'>{{ name }}</h3>\n        <p>({{ md5_fingerprint }})</p>\n        <button {{action didClickDelete this target=\"view\"}} class='btn btn-danger'>Delete</button>\n      </div>\n    </li>{{/each}}\n  </ul>\n  {{#unless length}}<div class='dark-list'>\n    <div class='title'>\n      <p>You have not added any public keys.</p>\n      <p>\n        Read this\n        <a href='http://help.nitrous.io/ssh-add/'>\n          help article\n        </a>\n        to learn how to add public keys.\n      </p>\n    </div>\n  </div>{{/unless}}\n  <div class='panel'>\n    <button {{action didClickAddKey target=\"view\"}} class='btn btn-primary'>\n      Add Public Key\n    </button>\n    <button {{action didClickRefresh target=\"view\"}} class='btn'>\n      Refresh\n    </button>\n  </div>\n</div>");
Ember.TEMPLATES["templates/public_keys/new"]=Ember.Handlebars.compile('<div class=\'container\'>\n  {{view AIO.HeaderView}}\n  <h2>Add a Public Key</h2>\n  <form class=\'form-horizontal\'>\n    <div {{bindAttr class=":control-group errors.name:error"}}>\n      <label class=\'control-label\' for=\'public_key_name\'>Name</label>\n      <div class=\'controls\'>\n        {{view Ember.TextField id="public_key_name" placeholder="Optional" valueBinding="name" disabledBinding="saving"}}\n        <span class=\'help-inline\'>{{ firstErrors.name }}</span>\n      </div>\n    </div>\n    <div {{bindAttr class=":control-group errors.key:error"}}>\n      <label class=\'control-label\' for=\'public_key_key\'>Key</label>\n      <div class=\'controls\'>\n        {{view Ember.TextArea id="public_key_key" rows="5" valueBinding="key" disabledBinding="saving"}}\n        <span class=\'help-inline\'>{{ firstErrors.key }}</span>\n      </div>\n    </div>\n    <div {{bindAttr class=":control-group errors.base:error"}}>\n      <div class=\'controls\'>\n        <button {{bindAttr disabled="saving"}} {{action didClickAddKey target="view"}} class=\'btn btn-primary\'>\n          Add Key\n        </button>\n        <button {{bindAttr disabled="saving"}} {{action didClickCancel target="view"}} class=\'btn\'>\n          Cancel\n        </button>\n        <span class=\'help-inline\'>{{ firstErrors.base }}</span>\n      </div>\n    </div>\n  </form>\n</div>');
Ember.TEMPLATES["templates/vagrant/index"]=Ember.Handlebars.compile("<div class='container'>\n  {{view AIO.HeaderView}}\n  <h2>Vagrant Settings</h2>\n  <div class='panel'>\n    {{#if access_token}}To revoke your existing access token, go to\n    <a class='link' href='/oauth/authorized_applications'>Applications</a>\n    page.\n    {{else}}\n    <button {{bindAttr disabled=\"fetching\"}} {{action didClickGetAccessToken target=\"view\"}} class='btn btn-primary'>\n      Get Access Token\n    </button>{{/if}}\n  </div>\n  {{#if access_token}}<div class='form-horizontal'>\n    <div class='darker-panel'>\n      <div class='control-group'>\n        <label class='control-label' for='vagrant_access_token'>Access Token</label>\n        <div class='controls'>\n          {{view AIO.SelectableTextField id=\"vagrant_access_token\" valueBinding=\"access_token\"}}\n        </div>\n      </div>\n      <div class='control-group'>\n        <label class='control-label' for='vagrantfile'>Example Vagrantfile</label>\n        <div class='controls'>\n          {{view AIO.SelectableTextArea id=\"vagrantfile\" valueBinding=\"vagrantfile\"}}\n        </div>\n      </div>\n    </div>\n  </div>{{/if}}\n</div>");
